import { useLocation } from "react-router-dom";

const RestaurantsHome = () => {
    const location = useLocation();
    console.log('Check--> ', location.pathname);

    return(
        <div className='container-fluid my-5 px-md-5'>
            <div className='row mt-5 pt-5 mx-md-2'>
                <div className='col-lg-10 col-10 offset-lg-1 offset-1 p-md-4 p-3 shadow'>
                    <h3 className='text-start'>{'Food Delivery in Syracuse'}</h3>
                    <p className='text-wrap'>Have your favorite Syracuse restaurant food delivered to your door with Uber Eats. Whether you want to order breakfast, lunch, dinner, or a snack, Uber Eats makes it easy to discover new and nearby places to eat in Syracuse. Browse tons of food delivery options, place your order, and track it by the minute.</p>
                </div>
            </div>
        </div>
    )
}

export default RestaurantsHome;
